import React from 'react';
//import PropTypes from 'prop-types';

class Pokemon extends React.Component {
  render() {
    //this.props;
    console.log(this.props);
    return (
      this.props.map((pokemon) => pokemon.name)
    )
  }
}

export default Pokemon;
